def beeramid(bonus: int, price: int) -> int:
    if bonus < price or price <= 0:
        return 0
    total_cans = bonus // price
    level = 0
    while True:
        level += 1
        cans_needed = level * level
        if total_cans < cans_needed:
            return level - 1
        total_cans -= cans_needed

